description:
सरकारले नेपाल बीमा प्राधिकरणको अध्यक्षमा चन्द्रकला पौडेललाई नियुक्त गरेको छ ।&amp;nbsp;

सोमबार बसेको मन्त्रिपरिषद् बैठकले संघीय मामिला तथा सामान्य प्रशासन मन्त्रालयकी सचिव पौडेललाई प्राधिकरणको जिम्मेवारी दिने निर्णय गरेको हो ।&amp;nbsp;

मन्त्रिपरिष

पाकिस्तानी टोलीले आगामी आईसीसी पुरुष टी&amp;ndash;२० विश्वकपमा भारतविरुद्ध कुनै पनि खेल नखेल्ने तयारी अगाडि बढाएको छ ।&amp;nbsp;

पाकिस्तान क्रिकेट बोर्ड (पीसीबी)को आगामी बैठकमा यस विषयमा छलफल हुने पाकिस्तानी सञ्चारमाध्यमले जनाएका छन् ।

